INSERT INTO `tbl_pages` VALUES (1,'::1',1,'Refund Policy','refund-policy','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3><strong>Refund Policy</strong></h3>\r\n\r\n<hr />\r\n<p>If you would like to claim refund against any order, the process begins after we perform Quality check of the products on your returned products. The quality check process may take 1 to 2 business days from the date we receive the returned item. We will inform you of the result as soon as we complete the quality check process.</p>\r\n\r\n<p>Once your refund is approved you can either claim a store credit Refund Voucher of the amount you had paid for your returned item or you could ask for a complete cash refund.</p>\r\n\r\n<p>In case of a store credit voucher, you can use the store credit voucher for a new purchase on the website. In case of a cash refund, the amount will be refunded to you via online bank transfer into your bank account, or via a cheque mailed to your address.</p>\r\n\r\n<p>In case of credit card payments, refund can either be claimed as a store credit Refund Voucher, a cash refund or via transaction reversal.</p>\r\n\r\n<p><strong>Reimbursed time frame post quality check:</strong></p>\r\n\r\n<div class=\"mt-4 row\">\r\n<div class=\"col-md-2\">&nbsp;</div>\r\n\r\n<div class=\"col-md-8\">\r\n<div class=\"card\" style=\"border:2px solid #cccccc\">\r\n<table class=\"table table-striped\">\r\n	<thead>\r\n		<tr>\r\n			<th>Refund Type</th>\r\n			<th>Time Frame</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Voucher Refund</td>\r\n			<td>24 hours</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Banks Transfer</td>\r\n			<td>48 hours</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cheque</td>\r\n			<td>48-72 hours</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p><strong>What is a Refund Voucher?</strong></p>\r\n\r\n<p>A Refund Voucher is a return mechanism of equal worth to the value paid for the item that you have returned.</p>\r\n\r\n<p>You can use a Refund Voucher at your next purchase, at the time of checkout just put your voucher code in the discount Colum and it will be redeemed. This Refund Voucher can be used on multiple purchases A refund voucher is valid for 185 days you need to use your voucher during this period, Voucher will be expired after the above said days.</p>\r\n\r\n<p><strong>How do I use my Refund Voucher? </strong></p>\r\n\r\n<p>Once you have been issued a refund voucher, the discount voucher will be sent to you via email.</p>\r\n\r\n<p>You can enter the code in the discount code box and click <strong>&quot;Apply Code&quot;</strong> during checkout at payment step.</p>\r\n\r\n<p><strong>If my returned product is not validated for refund, how do I get informed? </strong></p>\r\n\r\n<p>If your return is not valid then we will inform you to explain the issue and send the item(s) back to you again. Please make sure you are available at the corresponded time to accept the item at your doorstep. Failure to delivery will result in holding your item for a 30 day period which you can collect yourself from our office.</p>\r\n\r\n<p><strong>I have bought an item on promotion or with a Discount Code. What amount will be refunded to me?</strong></p>\r\n\r\n<p>For items purchased on sale, if a refund is allowed on the sale item, the amount refunded will be the exact amount paid for the item, and not its original value.</p>\r\n\r\n<p>Scenario:- If you purchased an item on sale for Rs.1000 and its original value was Rs.2000, we will refund you Rs.1000 only.</p>\r\n\r\n<p>If you purchased an item with a Refund voucher, we will refund you the sum of the amount you paid (including the amount of the refund voucher used).</p>\r\n</div>\r\n</div>\r\n</div>',0,'2019-04-11','17:15:10'),(2,'::1',1,'Return Policy','return-policy','<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"col-md-12\">\r\n<h3><strong>Refund Policy</strong></h3>\r\n\r\n<hr />\r\n<p>If you would like to claim refund against any order, the process begins after we perform Quality check of the products on your returned products. The quality check process may take 1 to 2 business days from the date we receive the returned item. We will inform you of the result as soon as we complete the quality check process.</p>\r\n\r\n<p>Once your refund is approved you can either claim a store credit Refund Voucher of the amount you had paid for your returned item or you could ask for a complete cash refund.</p>\r\n\r\n<p>In case of a store credit voucher, you can use the store credit voucher for a new purchase on the website. In case of a cash refund, the amount will be refunded to you via online bank transfer into your bank account, or via a cheque mailed to your address.</p>\r\n\r\n<p>In case of credit card payments, refund can either be claimed as a store credit Refund Voucher, a cash refund or via transaction reversal.</p>\r\n\r\n<p><strong>Reimbursed time frame post quality check:</strong></p>\r\n\r\n<div class=\"mt-4 row\">\r\n<div class=\"col-md-2\">&nbsp;</div>\r\n\r\n<div class=\"col-md-8\">\r\n<div class=\"card\" style=\"border:2px solid #cccccc\">\r\n<table class=\"table table-striped\">\r\n	<thead>\r\n		<tr>\r\n			<th>Refund Type</th>\r\n			<th>Time Frame</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Voucher Refund</td>\r\n			<td>24 hours</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Banks Transfer</td>\r\n			<td>48 hours</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cheque</td>\r\n			<td>48-72 hours</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<p><strong>What is a Refund Voucher?</strong></p>\r\n\r\n<p>A Refund Voucher is a return mechanism of equal worth to the value paid for the item that you have returned.</p>\r\n\r\n<p>You can use a Refund Voucher at your next purchase, at the time of checkout just put your voucher code in the discount Colum and it will be redeemed. This Refund Voucher can be used on multiple purchases A refund voucher is valid for 185 days you need to use your voucher during this period, Voucher will be expired after the above said days.</p>\r\n\r\n<p><strong>How do I use my Refund Voucher? </strong></p>\r\n\r\n<p>Once you have been issued a refund voucher, the discount voucher will be sent to you via email.</p>\r\n\r\n<p>You can enter the code in the discount code box and click <strong>&quot;Apply Code&quot;</strong> during checkout at payment step.</p>\r\n\r\n<p><strong>If my returned product is not validated for refund, how do I get informed? </strong></p>\r\n\r\n<p>If your return is not valid then we will inform you to explain the issue and send the item(s) back to you again. Please make sure you are available at the corresponded time to accept the item at your doorstep. Failure to delivery will result in holding your item for a 30 day period which you can collect yourself from our office.</p>\r\n\r\n<p><strong>I have bought an item on promotion or with a Discount Code. What amount will be refunded to me?</strong></p>\r\n\r\n<p>For items purchased on sale, if a refund is allowed on the sale item, the amount refunded will be the exact amount paid for the item, and not its original value.</p>\r\n\r\n<p>Scenario:- If you purchased an item on sale for Rs.1000 and its original value was Rs.2000, we will refund you Rs.1000 only.</p>\r\n\r\n<p>If you purchased an item with a Refund voucher, we will refund you the sum of the amount you paid (including the amount of the refund voucher used).</p>\r\n</div>\r\n</div>\r\n</div>',0,'2019-04-11','17:32:11'),(3,'::1',1,'About Us','about-us','<div class=\"container-fluid mb-5 pb-5\">\r\n	<div class=\"row\" id=\"aboutusbackground\">\r\n		<div class=\"col-md-12\">\r\n			<p class=\"text-white text-center aboutustext text-uppercase\">About Us</p>\r\n			<p class=\"aboutussubheading text-center\">Shopker.pk SAB MILTA HAI</p>\r\n		</div>\r\n	</div>\r\n    <div class=\"container mb-5\">\r\n        <div class=\"row\">\r\n            <div class=\"col-md-12\">\r\n                <p class=\"aboutuscontent\">Shopker is an online marketplace that aims to be the best online shopping portal with the broadest range of products available. At shopker, we connect people &amp; products by opening up a virtual world of possibilitywith the best available range of selection across so that you can get the greatest deals. We believe online shopping can be just as personal and engaging as entering a retail store. We promise to provide hassle-free online shopping experience all the way from product selection to timely delivery.Our approach is based on 3 basic principles:Clutter free presentation of products on the websiteEasier selection process with expert reviews and descriptionFaster and timely delivery of your orders.</p>\r\n                <h2 class=\"text-center pt-5 text-uppercase\"><b>Our approach is based on 3 basic principles</b></h2>\r\n    			<div class=\"row\">\r\n    				<div class=\"col-md-12\" align=\"center\">\r\n    					<hr style=\"width: 120px; border:2px solid #c4161f; border-radius: 10px;\" />\r\n    				</div>\r\n    			</div>\r\n                <div class=\"mt-5 row\">\r\n                    <div class=\"col-md-4\">\r\n                        <div class=\"rotateIn wow\"><img src=\"http://itechnocode.com/shopker/images/clutter.png\" style=\"height:100px; width:100px\" /></div>\r\n                        <h4 class=\"mt-5\"><b>Clutter free presentation of products on the website</b></h4>\r\n                    </div>\r\n                    <div class=\"col-md-4\">\r\n                        <div class=\"fadeIn wow\"><img src=\"http://itechnocode.com/shopker/images/selection.png\" style=\"height:100px; width:100px\" /></div>\r\n                        <h4 class=\"mt-5\"><b>Easier selection process with expert reviews and description</b></h4>\r\n                    </div>\r\n                    <div class=\"col-md-4\">\r\n                        <div class=\"fadeInLeft wow\"><img src=\"http://itechnocode.com/shopker/images/fastdelivery.png\" style=\"height:100px; width:100px\" /></div>\r\n                        <h4 class=\"mt-5\"><b>Faster and timely delivery of your<br />orders</b></h4>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>',0,'2019-04-11','18:33:40'),(4,'103.255.5.111',1,'test','test','<p>tedt</p>',1,'2019-07-11','14:59:24');
