rf Clip Pins For Women -12 Pcs Set','2019-07-07','03:20:06'),(204,'103.255.5.74',17,NULL,'Dollar Size Black Cow Leather Wallet For Men','dollar-size-black-cow-leather-wallet-for-men-shopker','<p>Dollar Size Black Cow Leather Wallet For Men<br></p>','<p>Dollar Size Black Cow Leather Wallet For Men<br></p>',7,'1xDollar Size Black Cow Leather Wallet For Men','0.5',NULL,NULL,NULL,689,'Dollar Size Black Cow Leather Wallet For Men','1400','999',6,'2019-07-08','2019-07-31',0,0,1,'00:00:00','00:00:00',NULL,NULL,NULL,'2019-07-08','06:11:26'),(206,'182.185.197.64',17,NULL,'Paint Coating Thickness Gauge Pen 100% Original Made in Poland','paint-coating-thickness-gauge-pen-100-original-made-in-poland-shopker','<p></p><ul><li>Easily Check Accidental area</li><li>No batteries or Charging</li><li>Low price</li><li>Long Life</li><li>Made In Poland 100% original </li><li>Not copy which is made is EU</li></ul><br><p></p>','<p></p><p>The<b>&nbsp;AUTO-LAK-TEST 3003</b>&nbsp;meter is a gauge for measuring the thickness of varnish coatings with an accuracy of 20 microns.</p><p>&nbsp;It is used for quick and precise checking whether the vehicle was painted in the past.</p><p>&nbsp;The tester does not require battery power, calibration and can be used for many years.</p><p>&nbsp;It is a meter and tester because it performs the function of measuring the thickness of varnish and performs the function of quick testing.</p><p>&nbsp;It is used to detect the thickness of paint coats that are invisible to the naked eye on vehicles made of sheet steel and galvanized steel.</p><p>The tester lets you know if a car accident is hidden under the beautiful varnish.</p><p>The AUTO-LAK-TEST BIT 3003 lacquer tester has a colour scale in microns which makes it very easy to read the thickness of the varnish or putty, even for those who check the car for the first time.</p><p><b>The individual colours on the scale indicate:</b></p><p>&nbsp;5. Blue colour- coating with a thickness of 0.0 to 100 microns - a thin coat of varnish (varnish without foundation or repeatedly polished)</p><p>4. Green colour - coating with a thickness of 100 to 200 microns for original varnishes. Warning; in newer car models, 180 micron thickness may indicate a thin layer of the second varnish.</p><p>3. Yellow colour- coating with a thickness of 200 to 300 microns - after painting repairs (\'\' second varnish \'\').</p><p>2. Red colour - coating with a thickness of 300 to 520 microns - surface after sheet metal repairs + a second varnish.</p><p>1. Black colour - coating with a thickness of over 520 - surface putty and varnished (the amount of putty about 0.5 mm).</p><p><b>How it works:</b></p><p>The thickness of the varnish and putty is measured by touching the tip of the tester with the magnet of the surface being tested (the surface must be clean and free of dust). Monotonous, not too fast movement, we pull the tester until the magnet breaks away from the tested surface. During this operation a colourful scale comes out. The thickness of the lacquer coating is read in microns with an accuracy of 25 microns. The result of the measurement is the highest indication on the scale of the tester, and also at this moment the scale automatically disappears.</p><p>Designed as a simple pen and with its MAGNETIC TIP, it can stick to any curved surface or a hard-to-reach place.</p><p>It is made of high-quality materials, making it the perfect choice to carry around and always be prepared.</p><p>It does not paint varnish and does not leave any traces on light or dark varnishes. Extremely easy to use, no battery required.</p><p>Its thickness gauge is water resistant and can be used in the rain and on a dirty car</p><p>It’s highly accurate due to its compatibility with a digital thickness gauge</p><p>The colourful measurement scale will help you understand the state of the car you’re testing, and it will easily reveal any hidden damages</p><p>It is perfect for checking if a car has been involved in an accident and if the lacquer is original. The tester can be used by both professional business to assess the condition of the parts, and by a buyer to appraise the quality of a car.</p><br><p></p>',7,'1x Paint Coating Thickness Gauge Pen 100% Original Made in Poland','0.4',10,10,10,766,'Paint Coating Thickness Gauge Pen 100% Original Made in Poland','6500','4999',6,'2019-07-09','2019-08-31',0,0,1,'00:00:00','00:00:00','https://www.youtube.com/watch?v=o5StsiDZSsM','Paint Coating Thickness Gauge Pen 100% Original Made in Poland','Paint Coating Thickness Gauge Pen 100% Original Made in Poland','2019-07-09','12:36:01'),(207,'182.185.197.64',17,NULL,'Genuine Leather Braid Steering Wheel Cover Automobile Braiding Covers-Black','genuine-leather-braid-steering-wheel-cover-automobile-braiding-covers-black-shopker','<p></p><ul><li>Genuine Leather Braid Steering Wheel Cover</li><li>Automobile Braiding Covers On The Steering Wheel</li><li>Car Interior Accessories 15 inch</li></ul><br><p></p>','<p></p><ul><li>Genuine Leather Braid Steering Wheel Cover</li><li>Automobile Braiding Covers On The Steering Wheel</li><li>Car Interior Accessories 15 inch</li></ul><br><p></p>',7,'1x Genuine Leather Braid Steering Wheel Cover Automobile Braiding Covers-Black','0.4',NULL,NULL,NULL,689,'Genuine Leather Braid Steering Wheel Cover Automobile Braiding Covers-Black','5000','2500',1,'2019-07-09','2019-08-31',0,0,1,'00:00:00','00:00:00',NULL,'Genuine Leather Braid Steering Wheel Cover Automobile Braiding Covers-Black','Genuine Leather Braid Steering Wheel Cover Automobile Braiding Covers-Black','2019-07-09','12:43:41'),(208,'182.185.197.64',1,NULL,'Women Luxury Bracelet Watches Crystal Dress Wristwatches Casual Quartz Watch','women-luxury-bracelet-watches-crystal-dress-wristwatches-casual-quartz-watch-754','<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Women Luxury Bracelet Watches Crystal Dress Wristwatches &nbsp;Casual Quartz Watch</li>\r\n	<li>Brand Name:Bowake</li>\r\n	<li>Band Length:19cm</li>\r\n	<li>Movement:Q